import React from 'react';

function Login() {
  function goRegister() {
    window.location.href = "#/register"
  }

  function goHomepage() {
    window.location.href = "#/homepage"
  }

  return (
    <div>
      <div> now&nbsp;in&nbsp;login&nbsp;page </div>
      <div onClick={goRegister}> register </div>
      <div onClick={goHomepage}> homepage </div>
    </div>
  );
}

export default Login;
